import Head from '../src/components/Head'

const Producto = (props) => {
    console.log(props);
    return (
        (!props.subproducto)?null:
        <>
            <Head title={props.subproducto.subProducto}/>
            <h1>Propducto</h1>
        </>
     );
}

Producto.getInitialProps = async({query,res})=>{
    let idSubProducto = query.idSubProducto;
    try {
        let reqSubProducto = await fetch(`https://api.oliverpetshop.com.ar/subproducto/${idSubProducto}`);

        if(reqSubProducto.status>=400){
            res.statusCode = reqSubProducto.status;
            return {subproducto:null,statusCode:reqSubProducto.status}
        };

        let dataSubProducto = await reqSubProducto.json();
        let subproducto = dataSubProducto.data[0];

        return{subproducto,statusCode:reqSubProducto.status}
    } catch (error) {
        return {subproducto:null,statusCode:503}
    }
};
 
export default Producto;
